function Home() {
  const crearSala = () => {
    const roomId = Math.random().toString(36).substring(2, 8);
    window.location.href = `/room/${roomId}`;
  };

  return (
    <div>
      <h1>Videoconferencia MVP</h1>
      <button onClick={crearSala}>Crear sala</button>
    </div>
  );
}

export default Home;
